import React from "react";
import "./home.css";
import {
  MDBJumbotron,
  MDBBtn,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCardTitle,
  MDBIcon
} from "mdbreact";

export const Home = () => (
  <div class="bg">
    <div className="papa text-center">
      <div className="texto">
        <h2 className="h1 display-3">SafariCO</h2>
        <h3 className="h1 display-2">WILDest dreams come true!</h3>
        <hr className="my-2" />
        <p className="lead">
          <MDBBtn color="primary">Book</MDBBtn>
        </p>
      </div>
    </div>
  </div>
);
